function minicheck(i){for(let c in i){let n=i[c];try{n(),console.log(`Minicheck did "${c}"`)}catch(i){console.log(`Minicheck failed "${c}":\n${i.stack}`)}}}function fail(i){throw new Error(`Minicheck fail: ${i}`)}function exists(i,c){if(!i)throw new Error(`Minicheck exists: ${c}`)}function equals(i,c,n){if(c!==i)throw new Error(`Minicheck equals: "${c}" != "${i}", ${n}`)}function match(i,c,n){if(!i.match(c))throw new Error(`Minicheck match: "${i}" not match "${c instanceof RegExp?c.toString():c}", ${n}`)}
